class Solution {
    public int makeTheIntegerZero(int num1, int num2) {
        if (num2 == 0) return num1 == 0 ? 0 : -1;
        int operations = 0;
        while (num1 != 0) {
            if (operations > 60) return -1; // Prevent infinite loop
            int i = 0;
            while (i <= 60 && ((1L << i) + num2 <= num1 || (1L << i) + num2 < 0)) {
                i++;
            }
            i--;
            if (i >= 0 && i <= 60) {
                num1 -= (1 << i) + num2;
                operations++;
            } else {
                break; // No suitable i found, break the loop
            }
        }
        return num1 == 0 ? operations : -1;
    }
}
